  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:38.650635\",\n\t\"name\": \"willapa-spartina-mapping-and-eradication-7089a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Willapa National Wildlife Refuge (Willapa
  NWR) continues to work toward the eradication of the non-native cordgrass, Spartina
  alterniflora (Spartina) from Willapa Bay. Treatment areas are within the Willapa
  Bay watershed on tidally influenced wetlands and tributaries of the bay. Today more
  than 99% of the Spartina has been eliminated, but crews face a daunting job finding
  the remaining plants. In 2014, along with our partners, Willapa NWR treated over
  1,700 plants totaling about 0.7 acres spread out over more than 30,000 acres in
  the salt marshes surrounding the bay. A combined total of 0.15 acres of Spartina
  was located and treated on South Bay, Long Island, Leadbetter, and East Hills units
  on Willapa NWR. Willapa NWR would continue to locate and treat Spartina infestations
  within the Willapa Bay Watershed and provide data to develop monitoring methods
  for verifying complete eradication. During the early season, the project would focus
  on efforts to locate and treat individual Spartina plants and clones. Spartina is
  a prolific seed producer making early detection paramount. Follow-up inspection
  of previously treated areas, searching for and treatment of new plants would occur
  during the late season. Spartina remains viable and green late into the growing
  season, while other vegetation turns brown, making it easier to detect.\",\n\t\"license_title\":
